    <>
    <div style={{height: '50px'}}>
    {props.alert &&  <div className={`alert alert-${props.alert.type} alert-dismissible fade show`} role="alert" > <strong className={`text-${props.alert.type}`}> {props.alert.type} </strong>: {props.alert.msg} </div>}
    
